import React, { useState, useEffect } from 'react';
import axios from 'axios';

// Url
import { getAllAssistants } from '../../../settings';

// Styles
import { MyBody, MyButton, UserTable } from './Assistant.styles';

const AssistantEndpoint = () => {
  const [assistants, setassistants] = useState([{}]);

  const fetchAssistants = async (URL) => {
    const response = await fetch(URL, {
      method: 'GET',
      headers: {
        'Content-Type': 'application/json',
      },
    });
    const myAssistants = await response.json();

    setUsers(
      myAssistants.map((assistants) => {
        return assistants;
      })
    );
  };
  useEffect(() => {
    fetchAssistants(getAllAssistants);
  }, []);

  return (
    <MyBody>
      <UserTable color={color}>
        <thead>
          <tr>
            <th>Id</th>
            <th>Name</th>
            <th>Username</th>
            <th>Email</th>
            <th>Phone</th>
            <th>Website</th>
          </tr>
        </thead>
        <tbody>
          {assistants.map((assistant) => (
            <tr key={+assistant.id}>
              <td>{assistant.id}</td>
              <td>{assistant.name}</td>
              <td>{assistant.username}</td>
              <td>{assistant.email}</td>
              <td>{assistant.phone}</td>
              <td>{assistant.website}</td>
            </tr>
          ))}
        </tbody>
      </UserTable>
    </MyBody>
  );
};

export default AssistantEndpoint;
